import React from 'react';
import './App.css';
import Appbar from './components/Appbar'
import User from './components/User';
import Home from './components/Home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
      <div className="App">
      <Appbar/>
      <Routes>
          <Route path="/create">
            <User />
          </Route>
          <Route path="/home">
            <Home />
          </Route>
      </Routes>
      </div>
  );
}

export default App;
